import React from 'react';
import {AppBar, Autocomplete, Box, TextField, Toolbar} from '@mui/material';
import MovieIcon from '@mui/icons-material/MovieCreation';

const Header = () => {
    const dummyArray=["eemro","3idiots"]
  return (
    <AppBar>
        <Toolbar>
           <Box width={'20%'}>
               <MovieIcon/>
           </Box>
           <Box width={'50%'} margin={'auto'}>
           <Autocomplete
        
        freeSolo
        options={dummyArray.map((option) => option)}
        renderInput={(params) => <TextField {...params} label="Search Across Movies" />}
      />
           </Box>
        </Toolbar>
    </AppBar>
  )
}

export default Header
